import Cookies from "js-cookie";
import React from "react";
import { useNavigate } from "react-router-dom";

const LayoutDashboard = (props) => {
    const navigate = useNavigate();

    const handleLogout = () => {
        Cookies.remove("token");
        navigate("/");
    };

    return (
        <>
            <main className="relative h-screen overflow-hidden bg-gray-100 dark:bg-gray-800">
                <div className="flex items-start justify-between">
                    <div className="relative hidden h-screen shadow-lg lg:block w-80">
                        <div className="h-full bg-white dark:bg-gray-700">
                            <div className="flex items-center justify-start pt-6 ml-8">
                                <p className="text-xl font-bold dark:text-white">Plannifer</p>
                            </div>
                            <nav className="mt-6">
                                <div>
                                    <a className="flex items-center justify-start w-full p-2 pl-6 my-2 text-gray-800 transition-colors duration-200 border-l-4 border-purple-500 dark:text-white" href="#">
                                        <span className="text-left">
                                            <svg width={20} height={20} fill="currentColor" viewBox="0 0 1792 1792" xmlns="http://www.w3.org/2000/svg">
                                                <path d="M1472 992v480q0 26-19 45t-45 19h-384v-384h-256v384h-384q-26 0-45-19t-19-45v-480q0-1 .5-3t.5-3l575-474 575 474q1 2 1 6zm223-69l-62 74q-8 9-21 11h-3q-13 0-21-7l-692-577-692 577q-12 8-24 7-13-2-21-11l-62-74q-8-10-7-23.5t11-21.5l719-599q32-26 76-26t76 26l244 204v-195q0-14 9-23t23-9h192q14 0 23 9t9 23v408l219 182q10 8 11 21.5t-7 23.5z"></path>
                                            </svg>
                                        </span>
                                        <span className="mx-2 text-sm font-normal">Dashboard</span>
                                    </a>
                                </div>
                            </nav>
                        </div>
                    </div>
                    <div className="flex flex-col w-full md:space-y-4">
                        <header className="z-40 flex items-center justify-end w-full h-16 px-5 text-sm bg-primary ">
                            <button onClick={handleLogout} className="flex items-center gap-1 p-2 rounded-lg border-2 border-quaternary hover:bg-quaternary hover:text-primary text-quaternary ease-in-out transition duration-700 ">
                                <i class="fa-solid fa-right-from-bracket"> </i> Logout
                            </button>
                        </header>
                        <div className="h-screen px-4 pb-24 overflow-auto md:px-6">dashboard</div>
                    </div>
                </div>
            </main>

            {props.children}
        </>
    );
};

export default LayoutDashboard;
